INSERT INTO `blogs` (`id`, `title`, `slug`, `topic_id`, `user_id`, `content`, `view`, `image`, `created`, `modified`) VALUES(1, 'Berita Esport', 'berita-esport', 1, 1, '<p><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Lorem Ipsum</strong><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.&nbsp;</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text.</span></p>', 102, 'valorant.jpg', '2022-04-18 12:46:17', '2022-05-17 10:28:46');
INSERT INTO `blogs` (`id`, `title`, `slug`, `topic_id`, `user_id`, `content`, `view`, `image`, `created`, `modified`) VALUES(2, 'Berita Valorant', 'berita-valorant', 2, 1, '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source.</span></p>', 158, 'valorant.jpg', '2022-04-18 12:48:05', '2022-05-18 03:30:17');
INSERT INTO `blogs` (`id`, `title`, `slug`, `topic_id`, `user_id`, `content`, `view`, `image`, `created`, `modified`) VALUES(3, 'Berita PES', 'berita-pes', 3, 1, '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English.</span></p><p><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Lorem Ipsum</strong><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span></p>', 314, 'pes2020.jpg', '2022-04-18 12:50:52', '2022-05-17 15:59:48');
INSERT INTO `blogs` (`id`, `title`, `slug`, `topic_id`, `user_id`, `content`, `view`, `image`, `created`, `modified`) VALUES(4, 'Deretan Juara Esports PON XX Papua 2021', 'deretan-juara-esports-pon-xx-papua-2021', 1, 1, '<p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51); overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Suara.com -&nbsp;</span><span style=\"color: rgb(51, 51, 51);\">Eksibisi&nbsp;</span><font face=\"inherit\" style=\"\"><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\"><b style=\"\">Esports</b></span></font><span style=\"color: rgb(51, 51, 51);\">&nbsp;PON XX Papua 2021 yang sekaligus menjadi tonggak sejarah baru bagi dunia esports di Indonesia, resmi ditutup pada Minggu (27/9/2021).</span></p><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51);\">Ajang yang digelar pada 22-26 September 2021 ini menampilkan empat game esports yang muncul di PON XX Papua 2021, yakni Mobile Legends, Free Fire, PUBG Mobile, dan&nbsp;</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all; color: rgb(0, 0, 0);\">PES 2021</span><span style=\"color: rgb(51, 51, 51);\">&nbsp;atau&nbsp;</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\">eFootball 2021</span><span style=\"color: rgb(51, 51, 51);\">.</span></p><div style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><center style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><div id=\"div-ad-oop\" data-ad-type=\"desktop_oop\" class=\"\" style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><div id=\"google_ads_iframe_/148558260/SuaraDesktop_31__container__\" style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0pt none; font: inherit; vertical-align: baseline;\"></div></div></center></div><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51);\">Tak hanya itu, Pengurus Besar Esports Indonesia (</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all; color: rgb(0, 0, 0);\">PBESI</span><span style=\"color: rgb(51, 51, 51);\">) juga menyelenggarakan pertandingan persahabatan untuk game Lokapala.</span></p><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Sebagai pertandingan persahabatan, game MOBA buatan Indonesia ini tidak menyediakan medali seperti empat game lainnya.</p><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Akan tetapi, finalis yang diberangkatkan ke Papua akan mendapatkan hadiah total Rp 200 juta yang disiapkan PBESI.</p><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Berikut daftar tim provinsi yang juara di Eksibisi Esports PON XX Papua 2021 yang digelar pada 22-26 September, dirangkum dari Instagram PBESI @pbesi_official, Senin (27/9/2021).</p><p style=\"text-align: center; overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><img src=\"https://esportpilgubjabar.com/files/Images/name/2022/04//b74519f2e97544aba7dd96461467ca24.jpg\" style=\"width: 50%;\"></p><p style=\"text-align: left; overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">PES 2021 atau eFootball 2021</span></p><ul style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Gold Medal: Jawa Barat</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Silver Medal: Kalimantan Selatan</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Bronze Medal: Gorontalo</li></ul><p style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Free Fire (FF)</span></p><ul style=\"overflow-wrap: break-word; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-st