INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(1, '3', 'Bagaimana cara melakukan pendaftaran?', '<p>Pendaftaran dilakukan dengan cara memilih cabor yang diinginkan dibagian menu \"Pendaftaran\", lalu lengkapi form pendaftaran sesuai dengan ketentuan.<br><br></p>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(2, '3', 'Bagaimana aturan pendaftaran yang berlaku?', '<p>Aturan pendaftaran yang berlaku sudah tercantum pada menu \"Aturan Pendaftaran\" dan secara garis besarnya adalah</p><ol><li>Calon peserta KEJUARAAN PIALA GUBERNUR ESPORT JABAR Tahun 2022 adalah Warga Negara Indonesia.</li><li>Penetapan Batas Usia calon peserta yaitu minimal berumur 15 tahun.</li><li>Calon peserta sudah melakukan vaksin ke-2 dengan menunjukan bukti surat vaksin ke-2 atau menunjukan bukti vaksin melalui aplikasi peduli lindungi.</li><li>Calon peserta yang akan bertanding wajib menjalani swab test, jika dalam pemeriksaan dinyatakan reaktif maka peserta tersebut dinyatakan gugur dan tidak boleh diganti (dianggap WO) dan diserahkan kepada Tim Peserta yang bersangkutan untuk ditindak lanjuti penanganan selanjutnya.<br><br></li></ol>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(3, '3', 'Bagaimana jika sudah melakukan pendaftaran?', '<p>Jika sudah melakukan pendaftaran, tahap selanjutnya pihak penyelenggara akan melakukan verifikasi terhadap data pendaftaran yang telah dikirimkan.&nbsp;</p><p>Jika data pendaftaran&nbsp;&nbsp;tersebut sudah sesuai dengan ketentuan, maka pihak penyelenggara akan menghubungi melalui kontak nomor telepon / email yang telah tercantum pada form data pendaftaran.</p><p>Jika data pendaftaran tersebut tidak sesuai dengan ketentuan, maka pihak penyelenggara berhak untuk menolak calon peserta.</p>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(4, '3', 'Sampai Kapan Batas Pendaftaran Dibuka?', '<p>Pendaftaran dibuka dari tanggal 28 April - 22 Mei 2022 ataupun hingga slot terpenuhi pada masing - masing cabor.</p>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(5, '4', 'Berapa jumlah slot maksimal yang disediakan penyelenggara? ', '<p>Slot maksimal masing - masing cabor sebagai berikut :&nbsp;</p><p>PES : 128 slot</p><p>MLBB : 256 slot</p><p>PUBGM : 240 slot</p><p>FF : 200 slot</p><p>Valorant : 128 slot</p>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(6, '4', 'Apakah diperbolehkan untuk multislot?', '<p>Tidak diperbolehkan untuk multislot pada masing - masing cabor.</p>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(7, '3', 'Apakah ada batas minimal umur untuk peserta pendaftar?', '<p>Ada, sudah tercantum pada peraturan pertandingan</p>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(8, '5', 'bagaimana perhitungan point untuk PUBGM dan FF?', '<p>Informasi mengenai perhitungan point akan diberitahukan saat technical meeting</p>');
INSERT INTO `faqs` (`id`, `faq_category_id`, `question`, `answer`) VALUES(9, '4', 'Bagaimana sistem penyelenggaraan kompetisi ini?', '<p>Untuk tahap kualifikasi awal diselenggarakan online, fase selanjutnya diadakan onsite sesuai dengan venue yang sudah ditentukan.</p>');
