INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(10, 'id', 'Blogs', 3, 'content', '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English.</span></p><p><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Lorem Ipsum</strong><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.</span></p><p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify;\">Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span></p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(11, 'id', 'Blogs', 4, 'title', 'Deretan Juara Esports PON XX Papua 2021');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(12, 'id', 'Blogs', 4, 'content', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51); overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Suara.com -&nbsp;</span><span style=\"color: rgb(51, 51, 51);\">Eksibisi&nbsp;</span><font face=\"inherit\"><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\"><b>Esports</b></span></font><span style=\"color: rgb(51, 51, 51);\">&nbsp;PON XX Papua 2021 yang sekaligus menjadi tonggak sejarah baru bagi dunia esports di Indonesia, resmi ditutup pada Minggu (27/9/2021).</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51);\">Ajang yang digelar pada 22-26 September 2021 ini menampilkan empat game esports yang muncul di PON XX Papua 2021, yakni Mobile Legends, Free Fire, PUBG Mobile, dan&nbsp;</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\">PES 2021</span><span style=\"color: rgb(51, 51, 51);\">&nbsp;atau&nbsp;</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\">eFootball 2021</span><span style=\"color: rgb(51, 51, 51);\">.</span></p><div style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><center style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><div id=\"div-ad-oop\" data-ad-type=\"desktop_oop\" class=\"\" style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><div id=\"google_ads_iframe_/148558260/SuaraDesktop_31__container__\" style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0pt none; font: inherit; vertical-align: baseline;\"></div></div></center></div><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51);\">Tak hanya itu, Pengurus Besar Esports Indonesia (</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\">PBESI</span><span style=\"color: rgb(51, 51, 51);\">) juga menyelenggarakan pertandingan persahabatan untuk game Lokapala.</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Sebagai pertandingan persahabatan, game MOBA buatan Indonesia ini tidak menyediakan medali seperti empat game lainnya.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Akan tetapi, finalis yang diberangkatkan ke Papua akan mendapatkan hadiah total Rp 200 juta yang disiapkan PBESI.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Berikut daftar tim provinsi yang juara di Eksibisi Esports PON XX Papua 2021 yang digelar pada 22-26 September, dirangkum dari Instagram PBESI @pbesi_official, Senin (27/9/2021).</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; text-align: center; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><img src=\"https://esportpilgubjabar.com/files/Images/name/2022/04//b74519f2e97544aba7dd96461467ca24.jpg\" style=\"width: 663.5px;\"></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">PES 2021 atau eFootball 2021</span></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; overflow-wrap: break-word; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Gold Medal: Jawa Barat</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Silver Medal: Kalimantan Selatan</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Bronze Medal: Gorontalo</li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Free Fire (FF)</span></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; overflow-wrap: break-word; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Gold Medal: Sulawesi Tenggara</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Silver Medal: Bengkulu</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Bronze Medal: Maluku</li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\"></span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Mobile Legends: Bang-Bang (MLBB)</span></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; overflow-wrap: break-word; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-a