INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(58, 'en', 'Pages', 1, 'content', '<style type=\"text/css\">\r\n	.heading-text.heading-section h2:before{color: #fff;}\r\n</style>\r\n<section>\r\n    <div class=\"container\">\r\n        <div class=\"heading-text heading-section text-center\">\r\n            <h2>KEJUARAAN ESPORT PIALA GUBERNUR <br> JAWA BARAT TAHUN 2022</h2>\r\n        </div>\r\n        <div class=\"row m-b-60\">\r\n            <div class=\"col-lg-12 m-b-40\">\r\n                <div style=\"text-align: justify;\">\r\n                    <p>Perkembangan cabang olahraga Esport di Indonesia semakin hari semakin baik dan terus berkembang menjadi sebuah industri olahraga, begitu juga di Provinsi Jawa Barat dengan jumlah penduduk paling banyak di Indonesia yaitu 50 juta jiwa dapat melahirkan penggiat olahraga Esport yang kini mulai banyak peminatnya dan tersebar diberbagai kalangan usia, mulai dari remaja hingga kalangan dewasa.<br><br>\r\n                    Esport adalah salah satu cabang Olahraga perorangan dan beregu dan telah menjadi komoditi strategis untuk mengembangkan inovasi dan kreasi positif para penggemar nya agar senantiasa berusaha memajukan pembinaan dan pembangunan Olahraga Esport baik di Jawa Barat Maupun Indonesia. Jawa Barat merupakan salah satu provinsi tempat bagi penggiat Esport  dan penyumbang atlet Esport Indonesia yang mampu berprestasi di kejuaraan dunia dan kejuaraan internasional lainnya.<br><br>\r\n                    Pemerintah Provinsi Jawa Barat melalui Dinas Pemuda dan Olahraga Provinsi Jawa Barat mempunyai concern khusus terhadap perkembangan olahraga ESport, berkolaborasi dengan Pengurus Provinsi ESport Indonesia (Pengprov ESI) Jawa Barat menyelenggarakan <b>KEJUARAAN ESPORT PIALA GUBERNUR JAWA BARAT TAHUN 2022</b> dengan tujuan utama untuk memberikan wadah bagi para penggiat olahraga Esport dalam mengembangkan potensi diri dan juga meningkatkan prestasi para atlet Esport dalam sebuah kompetisi yang kompetitif. Dengan harapan akan muncul para atlet potensial yang dapat berprestasi bukan hanya untuk Juara Jawa Barat, tapi dapat menjadi Juara Indonesia dan Juara Internasional mampu berkontribusi bagi Indonesia.</p>	\r\n	            </div>\r\n            </div>\r\n            <div class=\"col-12\">\r\n            	<div class=\"bg-overlay\" data-style=\"11\" style=\"z-index: -1;\"></div>\r\n            	<div class=\"row\">\r\n		            <div class=\"col-lg-6 m-b-40 p-20\">\r\n						<div class=\"heading-text heading-section text-center text-light\">\r\n							<h2>VISI</h2>\r\n							<span class=\"lead\">Meningkatkan kuantitas dan kualitas atlet Esport yang kompetitif, sehingga dapat berprestasi ditingkat Nasional dan Internasional.</span>\r\n						</div>\r\n					</div>\r\n		            <div class=\"col-lg-6 p-20\">\r\n						<div class=\"heading-text heading-section text-center text-light\">\r\n							<h2>MISI</h2>\r\n						</div>					\r\n						<ol class=\"text-light\" style=\"margin-left: 15px;\">\r\n							<li>Mewadahi para para pemuda dan penggiat Esport untuk mengapresiasikan diri melalui sebuah kompetisi yang kompetitif.</li>\r\n							<li>Mengembangkan kultur pembinaan prestasi yang baik dicabang olahraga Esport.</li>\r\n							<li>Membangun kultur dan sistem kompetisi yang baik, berjenjang dan berkesinambungan.</li>\r\n							<li>Mewujudkan lingkungan Esport yang kompetitif dan Juara, menjungjung tinggi sportivitas dan saling menghargai satu sama lain.</li>\r\n						</ol>\r\n		            </div>\r\n	            </div>\r\n            </div>\r\n        </div>\r\n        <div class=\"row\">\r\n        	<div class=\"col-12 mb-5\">        		\r\n	            <p class=\"mb-3\">Nomor yang Dipertandingkan di Cabang Olahraga Esports pada <b>KEJUARAAN ESPORT PIALA GUBERNUR JAWA BARAT TAHUN 2022</b> adalah 3 kategori yaitu : <br>\r\n				Kategori Personal Computer (PC), Kategori Handphone (Mobile), Kategori Console, dan memainkan 5 Nomor Pertandingan / Kelas.\r\n				</p>\r\n        	</div>\r\n			<div class=\"col-12 mb-5\">\r\n                <h4>Kategori Handphone (Mobile)</h4>\r\n                <div class=\"row\">\r\n                    <div class=\"col-md-4\">\r\n                        <a class=\"image-hover-zoom mb-3\" href=\"./front-assets-new/mobile-legend.jpg\" data-lightbox=\"gallery-image\"><img src=\"./front-assets-new/mobile-legend.jpg\" width=\"100%\"></a>\r\n                    </div>\r\n                    <div class=\"col-md-4\">\r\n                        <a class=\"image-hover-zoom mb-3\" href=\"./front-assets-new/pubg-mobile.jpg\" data-lightbox=\"gallery-image\"><img src=\"./front-assets-new/pubg-mobile.jpg\" width=\"100%\"></a>\r\n                    </div>\r\n                    <div class=\"col-md-4\">\r\n                        <a class=\"image-hover-zoom mb-3\" href=\"./front-assets-new/free-fire.jpg\" data-lightbox=\"gallery-image\"><img src=\"./front-assets-new/free-fire.jpg\" width=\"100%\"></a>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            <div class=\"col-md-6 mb-5\">                        \r\n                <h4>Kategori Personal Computer (PC)</h4>\r\n                <a class=\"image-hover-zoom\" href=\"./front-assets-new/valorant.jpg\" data-lightbox=\"gallery-image\"><img src=\"./front-assets-new/valorant.jpg\" width=\"100%\"></a>\r\n            </div>\r\n            <div class=\"col-md-6 mb-5\">\r\n                <h4>Kategori Console</h4>\r\n                <a class=\"image-hover-zoom\" href=\"./front-assets-new/pes-2021.jpg\" data-lightbox=\"gallery-image\"><img src=\"./front-assets-new/pes-2021.jpg\" width=\"100%\"></a>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>');
