INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(85, 'en', 'FaqCategories', 3, 'name', 'Pendaftaran');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(86, 'en', 'FaqCategories', 4, 'name', 'Informasi Umum');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(87, 'en', 'Faqs', 1, 'question', 'Bagaimana cara melakukan pendaftaran?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(88, 'en', 'Faqs', 1, 'answer', '<p>Pendaftaran dilakukan dengan cara memilih cabor yang diinginkan dibagian menu \"Pendaftaran\", lalu lengkapi form pendaftaran sesuai dengan ketentuan.<br></p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(89, 'en', 'Faqs', 2, 'question', 'Bagaimana aturan pendaftaran yang berlaku?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(90, 'en', 'Faqs', 2, 'answer', '<p>Aturan pendaftaran yang berlaku sudah tercantum pada menu \"Aturan Pendaftaran\" dan secara garis besarnya adalah</p><ol><li>Calon peserta KEJUARAAN PIALA GUBERNUR ESPORT JABAR Tahun 2022 adalah Warga Negara Indonesia.</li><li>Penetapan Batas Usia calon peserta yaitu minimal berumur 15 tahun.</li><li>Calon peserta sudah melakukan vaksin ke-2 dengan menunjukan bukti surat vaksin ke-2 atau menunjukan bukti vaksin melalui aplikasi peduli lindungi.</li><li>Calon peserta yang akan bertanding wajib menjalani swab test, jika dalam pemeriksaan dinyatakan reaktif maka peserta tersebut dinyatakan gugur dan tidak boleh diganti (dianggap WO) dan diserahkan kepada Tim Peserta yang bersangkutan untuk ditindak lanjuti penanganan selanjutnya.<br></li></ol>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(91, 'en', 'Faqs', 3, 'question', 'Bagaimana jika sudah melakukan pendaftaran?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(92, 'en', 'Faqs', 3, 'answer', '<p>Jika sudah melakukan pendaftaran, tahap selanjutnya pihak penyelenggara akan melakukan verifikasi terhadap data pendaftaran yang telah dikirimkan.&nbsp;</p><p>Jika data pendaftaran&nbsp;&nbsp;tersebut sudah sesuai dengan ketentuan, maka pihak penyelenggara akan menghubungi melalui kontak nomor telepon / email yang telah tercantum pada form data pendaftaran.</p><p>Jika data pendaftaran tersebut tidak sesuai dengan ketentuan, maka pihak penyelenggara berhak untuk menolak calon peserta.</p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(93, 'en', 'Faqs', 4, 'question', 'Sampai Kapan Batas Pendaftaran Dibuka?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(94, 'en', 'Faqs', 4, 'answer', '<p>Pendaftaran dibuka dari tanggal 28 April - 22 Mei 2022 ataupun hingga slot terpenuhi pada masing - masing cabor.</p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(95, 'en', 'Faqs', 5, 'question', 'Berapa jumlah slot maksimal yang disediakan penyelenggara? ');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(96, 'en', 'Faqs', 5, 'answer', '<p>Slot maksimal masing - masing cabor sebagai berikut :&nbsp;</p><p>PES : 128 slot</p><p>MLBB : 256 slot</p><p>PUBGM : 240 slot</p><p>FF : 200 slot</p><p>Valorant : 128 slot</p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(97, 'en', 'Faqs', 6, 'question', 'Apakah diperbolehkan untuk multislot?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(98, 'en', 'Faqs', 6, 'answer', '<p>Tidak diperbolehkan untuk multislot pada masing - masing cabor.</p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(99, 'en', 'Faqs', 7, 'question', 'Apakah ada batas minimal umur untuk peserta pendaftar?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(100, 'en', 'Faqs', 7, 'answer', '<p>Ada, sudah tercantum pada peraturan pertandingan</p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(101, 'en', 'FaqCategories', 5, 'name', 'Cabor');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(102, 'en', 'Faqs', 8, 'question', 'bagaimana perhitungan point untuk PUBGM dan FF?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(103, 'en', 'Faqs', 8, 'answer', '<p>Informasi mengenai perhitungan point akan diberitahukan saat technical meeting</p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(104, 'en', 'Faqs', 9, 'question', 'Bagaimana sistem penyelenggaraan kompetisi ini?');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(105, 'en', 'Faqs', 9, 'answer', '<p>Untuk tahap kualifikasi awal diselenggarakan online, fase selanjutnya diadakan onsite sesuai dengan venue yang sudah ditentukan.</p>');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(106, 'en', 'Blogs', 4, 'title', 'Deretan Juara Esports PON XX Papua 2021');
INSERT INTO `i18n` (`id`, `locale`, `model`, `foreign_key`, `field`, `content`) VALUES(107, 'en', 'Blogs', 4, 'content', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51); overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Suara.com -&nbsp;</span><span style=\"color: rgb(51, 51, 51);\">Eksibisi&nbsp;</span><font face=\"inherit\"><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\"><b>Esports</b></span></font><span style=\"color: rgb(51, 51, 51);\">&nbsp;PON XX Papua 2021 yang sekaligus menjadi tonggak sejarah baru bagi dunia esports di Indonesia, resmi ditutup pada Minggu (27/9/2021).</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51);\">Ajang yang digelar pada 22-26 September 2021 ini menampilkan empat game esports yang muncul di PON XX Papua 2021, yakni Mobile Legends, Free Fire, PUBG Mobile, dan&nbsp;</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\">PES 2021</span><span style=\"color: rgb(51, 51, 51);\">&nbsp;atau&nbsp;</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\">eFootball 2021</span><span style=\"color: rgb(51, 51, 51);\">.</span></p><div style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><center style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><div id=\"div-ad-oop\" data-ad-type=\"desktop_oop\" class=\"\" style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><div id=\"google_ads_iframe_/148558260/SuaraDesktop_31__container__\" style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0pt none; font: inherit; vertical-align: baseline;\"></div></div></center></div><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px;\"><span style=\"color: rgb(51, 51, 51);\">Tak hanya itu, Pengurus Besar Esports Indonesia (</span><span style=\"border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; transition-duration: 0.3s; transition-property: all;\">PBESI</span><span style=\"color: rgb(51, 51, 51);\">) juga menyelenggarakan pertandingan persahabatan untuk game Lokapala.</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Sebagai pertandingan persahabatan, game MOBA buatan Indonesia ini tidak menyediakan medali seperti empat game lainnya.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Akan tetapi, finalis yang diberangkatkan ke Papua akan mendapatkan hadiah total Rp 200 juta yang disiapkan PBESI.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\">Berikut daftar tim provinsi yang juara di Eksibisi Esports PON XX Papua 2021 yang digelar pada 22-26 September, dirangkum dari Instagram PBESI @pbesi_official, Senin (27/9/2021).</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; text-align: center; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><img src=\"https://esportpilgubjabar.com/files/Images/name/2022/04//b74519f2e97544aba7dd96461467ca24.jpg\" style=\"width: 663.5px;\"></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; vertical-align: baseline;\">PES 2021 atau eFootball 2021</span></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; overflow-wrap: break-word; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Gold Medal: Jawa Barat</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Silver Medal: Kalimantan Selatan</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Bronze Medal: Gorontalo</li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; overflow-wrap: break-word; padding: 0px 0px 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 24px; font-family: Arial, sans-serif; vertical-align: baseline; letter-spacing: 0.5px; color: rgb(51, 51, 51);\"><span style=\"overflow-wrap: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Free Fire (FF)</span></p><ul style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; overflow-wrap: break-word; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: inherit; font-family: Arial, sans-serif; vertical-align: baseline; list-style: none; color: rgb(51, 51, 51); letter-spacing: 0.5px;\"><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; list-style: disc;\">Gold Medal: Sulawesi Tenggara</li><li style=\"overflow-wrap: break-word; margin: 0px 0px 5px 15px; padding: 0px; border: 0px; font: inherit; vertical-align: baselin